import { memo } from "react";
import "./FrameComponent27.css";
const FrameComponent27 = memo(() => {
  return (
    <div className="frame-parent253">
      <div className="rectangle-parent8">
        <img className="frame-child91" alt="" src="/rectangle-16@2x.png" />
        <div className="st-march-2023-parent">
          <div className="st-march-20231">1st March 2023</div>
          <div className="we-exist-to5">
            We exist to bring maturity to church and transformation to society
            through equipped leadership based on Christian values and principles
            by training people in their area of calling
          </div>
        </div>
      </div>
      <div className="button-primary11">
        <div className="button11">Read More</div>
      </div>
    </div>
  );
});

export default FrameComponent27;
